def Pythonconversion(A):  # converts into python, specifically the full vector of outputs of four bell states. A is inputted as a string
    C = [i for i in A]
    for i in range(len(C)):
        if C[i] == '^':
            C[i] = '**'
        elif C[i]== '[':
            C[i]= '('
        elif C[i]== ']':
            C[i]= ')'
        elif i< (len(C)-4) and C[i]== 'S' and C[i+1] =='q' and C[i+2] == 'r' and C[i+3] == 't':
            C[i]= 'np.s'
            C[i+1]= 'q'
            C[i+2]= 'r'
            C[i+3]= 't'
        elif C[i]== '{':
            C[i]= '['
        elif C[i]== '}':
            C[i]= ']'
    out = ''.join(C)
    return out


